$pipboy: #2dc92d;
$pipboy-light: #2dc92d49;
$background: #1a1a1a;

@font-face {
  font-family: "Space Mono", monospace;
  src: url("https://fonts.googleapis.com/css2?family=Noto+Sans+Display:ital,wght@0,100..900;1,100..900&family=Noto+Serif:ital,wght@0,100..900;1,100..900&family=Share+Tech&family=Space+Mono:ital,wght@0,400;0,700;1,400;1,700&family=Ubuntu:ital,wght@0,300;0,400;0,500;0,700;1,300;1,400;1,500;1,700&display=swap");
}

$font-size-small: 12px;
$font-size-medium: 16px;
$font-size-large: 22px;

* {
  font-family: "Space Mono", monospace;
  color: $pipboy;
  margin: 0;
  padding: 0;
  text-decoration: none;

  &::-webkit-scrollbar {
    width: 4px;
  }

  &::-webkit-scrollbar-track {
    background: transparent;
  }

  &::-webkit-scrollbar-thumb {
    background: $pipboy;
    border-radius: 4px;
  }
}

p {
  line-height: 120%;
}

.no-event {
  pointer-events: none;
  user-select: none;
}

.typing-effet {
  position: relative;
  &::after {
    content: "";
    animation: typing 1s infinite;
    display: block;
    position: absolute;
    right: -16px;
    bottom: 0;
    width: 16px;
    height: 2px;
    background: $pipboy;
    
    @keyframes typing {
      0% {
        opacity: 0;
      }
      49% {
        opacity: 0;
      }
      50% {
        opacity: 1;
      }
      99% {
        opacity: 1;
      }
      100% {
        opacity: 0;
      }
    }
  }
}

.glitch {
  $animation-duration: var(--animation-duration, 8s);
  animation: glitch $animation-duration ease-in infinite;
  @keyframes glitch {
    0% {
      transform: skewX(15deg);
    }
    0.3% {
      transform: skewX(0deg);
      filter: brightness(1);
    }
    0.6% {
      transform: skewX(20deg);
      filter: brightness(1.5);
    }
    0.8% {
      transform: skewX(0deg);
      filter: brightness(1);
    }
    50% {
      transform: skewX(0deg);
      opacity: 1;
    }
    50.1% {
      transform: skewX(15deg);
      opacity: 0.5;
    }
    50.4% {
      transform: skewX(2deg);
    }
    51% {
      transform: skewX(0deg);
      opacity: 1;
    }
    55% {
      transform: skewX(0deg);
    }
    99% {
      transform: skewX(0deg);
    }
  }
}

.vautl-boy {
  background-image: url("../../../assets/special/strength.svg");
  width: 200px;
  background-size: cover;
  background-repeat: no-repeat;
}

